export class TileQuadtree {
    constructor(grid: any);
    _grid: any;
    _root: any;
    _tiles: {};
    _tilesCount: number;
    getTileByKey(key: any): any;
    getTile(z: any, x: any, y: any): any;
    getTileChildren(tile: any): any;
    _getOrCreateTile(z: any, x: any, y: any): any;
    /**
     * 判断给定的瓦片tile是否是指定xyz瓦片的祖先瓦片
     * @param z 指定瓦片的z层级
     * @param x 指定瓦片的x行列号
     * @param y 指定瓦片的y行列号
     * @param tile 祖先瓦片对象
     * @returns 如果tile瓦片是指定xyz瓦片的祖先瓦片，则返回 true；否则返回 false
     */
    isAncestralTile(z: any, x: any, y: any, tile: any): boolean;
    _selectOrCreateAncestralTiles(z: any, x: any, y: any, tiles: any): any;
    _invokeTileCreateHook(tiles: any): void;
    get root(): any;
}
